private boolean isUpperVowel (int v) {
  switch (v) {
    case 'A':
    case 'E':
    case 'I':
    case 'O':
    case 'U':
    // vowels with acute accent (fada)
    case '\u00c1':
    case '\u00c9':
    case '\u00cd':
    case '\u00d3':
    case '\u00da':
      return true;
    default:
      return false;
  }
}

